import React from 'react';

function ManageAttendance() {
  return (
    <div>
      <h2>إدارة الحضور</h2>
      <p>هنا يمكنك تسجيل الحضور والغياب للطلاب.</p>
    </div>
  );
}

export default ManageAttendance;
